import React from 'react';
import Navbar from './components/Navbar';
import { BrowserRouter as Route, Router, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
      <Router>
        <Navbar />
        <Routes>
          <Route path='/' exact />
        </Routes>
      </Router>
  );
}

export default App;
